COMMENTS: |
    Films Ta<sub>2</sub>O<sub>5</sub>;
    Deposited by e-beam evaporation on c-Si;
    Five samples with a polycrystalline structure and nominal thicknesses 20–250 nm;
    Multi-sample method;
    Heterogenous data processing combining ellipsometric and spectrophotometric measurements;
    Slightly inhomogeneous layers;
    Optical constants correspond to the characterization with homogeneous films;
    Room temperature.
